import React from 'react'
import image from './milk.jpg'
import curd from './curd.jpg'
const About = () => {
  return (
    <div>
      <h1>Our Products</h1>
      <img src={image}></img>
      <img src={curd}></img>
    </div>
  )
}

export default About
